import React from 'react';
import '../css/Card.css';
import { connect } from 'react-redux';

export class Card extends React.Component {

    render(){
        return (
            <div>
                <div id = "card">
                <img src={process.env.PUBLIC_URL+"card/blue/heart/stripe/one.svg"} alt="" className="logoimg1"/>  
                </div>
                <div id = "card">
                <img src="card/blue/heart/stripe/two.svg" alt="" className="logoimg"/> 
                </div>
                <div id = "card">
                <img src="card/blue/heart/stripe/three.svg" alt="" className="logoimg"/> 
                </div>

            </div>

        )
    }
}

let mapDispatchToProps = function(dispatch, props) {
    return {
      dispatch: dispatch,
    }
}


let mapStateTpProps = function(state, props) {
    return {
        deck : state.cards.deck,
        tableShow : state.cards.onTable,
        selectedCards: state.cards.selectedCards,
    }
}

export default connect(
    mapStateTpProps,
    mapDispatchToProps
)(Card)
